INSERT INTO `experience` VALUES (1,NULL,'2021-09-14 07:18:30','Assistant Lecturer','as an assistant lecturer, I was responsible for assisting students in learning. I\'ve already assigned to be an assistant lecturer for the Intelligent Decision Support System and Fundamental of Mathematics courses.','498b550c-b15b-407f-bbfe-75d40ccf78c3','1'),(2,NULL,'2021-09-14 07:19:18','Marketing and Communication','I was responsible for planning marketing strategy, research to determine market segmentation, and also responsible for direct marketing to prospective students at the campus expo event.','e6b0bd59-7573-470e-b0f5-5d45360662f3','1'),(3,NULL,'2021-09-14 07:19:38','Volunteer Teacher','I have experience doing volunteer activities as a teacher at Islamic Outreach Abim Kelantan Malaysia. At that time I was in charge of teaching material about Islam.','cf645ca6-734e-4a1a-91eb-08c89007336f','1'),(4,NULL,NULL,'President BEM UII 2030','Just for testing the content I have experience doing volunteer activities as a teacher at Islamic Outreach Abim Kelantan Malaysia. At that time I was in charge of teaching material about Islam.','b858c358-797c-4c20-9e38-57c97102d412','1');
