INSERT INTO `project` VALUES (1,'draft',NULL,'2021-09-12 14:15:37','Ri-Cycle','<p>RI-Cycle is an application to detect the type of waste and then provide recommendations on how to recycle it. Ri-Cycle uses Machine Learning technology, especially image classification. I contributed to making Machine Learning models.</p>','1','9535dfc8-5879-40ef-8374-30d14158cb4a'),(2,'draft',NULL,'2021-09-12 14:22:44','MyCalorie','<p>My Calorie is an application to calculate the number of calories in food using Machine Learning technology, especially object detection. Users only need to take a photo of the food then the app will show the number of calories. This application is in the prototyping stage.</p>','1','56b0fb68-1c6f-426b-ae1d-4c206fd2db00'),(3,'draft',NULL,'2021-09-12 14:23:47','Plesiran','<p>PLESIRAN is an application that can be used by tourists in planning tourism activities in Yogyakarta. Users can plan schedules and even costs that will be incurred during the tour. Plesiran provides tourist and culinary recommendations.</p>','1','dbfd92c6-fd96-4dd1-8335-b9d9d6f27c33'),(7,'published',NULL,NULL,'Sistem Pendukung Keputusan Klinis Diagnosis dan Pemrioritasan Penanganan Pasien Penderita Kanker Usus Besar','This system uses the Naive algorithm Bayes Classification. The system is a prototype, but the calculation algorithm has been designed.','2','38994bee-8fc0-4aeb-9ed6-7946f012b4ca'),(8,'published',NULL,NULL,'Sistem Pendukung Keputusan Klinis Mengukur Tingkat Probabilitas Mendonor Plasma Konvalesen','This system uses logic Fuzzy Inference System to measure the probability.','2','26fbac7f-2521-45a0-832a-2096c94bce02');
/*!40000 ALTER TABLE `project` ENABLE KEYS */;
UNLOCK TABLES;

