INSERT INTO `summary` VALUES (1,'published',NULL,'fb1483f6-c530-4e9c-af99-e0e43006cb09','2021-09-14 06:57:14','<p>Mina is a student majoring <strong>Informatics at Universitas Islam Indonesia</strong>. Currently, Mina is undergoing an <strong>internship at the Lumintu Logic company as a Systems Analyst</strong>. During the study Mina was active in several activities such as being an assistant lecturer, participating in the Marketing and Communication team at Industrial Technology Faculty, also participated in the Bangkit 2021 Machine Learning Path program. Mina\'s passions are <strong>Data Science, UI/UX design, and Mathematics</strong>. Currently Mina is learning new things to develop her technical skills and abilities in industry placement specifically as a system analyst.</p>');
